# new 3 mu-ti type

a500s = [a500, a5001, a5002, a5003]
a300s = [a300, a3001, a3002, a3003, a3004]
a100s = [a100, a1001, a1002, a1003, a1004]

b500s = [b500, b5001, b5002, b5003, b5004]
b300s = [b300, b3001, b3002, b3003, b3004]
b100s = [b100, b1001, b1002, b1003, b1004]

c500s = [c500, c5001, c5002, c5003, c5004]
c300s = [c300, c3001, c3002, c3003, c3004]
c100s = [c100, c1001, c1002, c1003, c1004]

avelist, lowlist, highlist, avelist2, lowlist2, highlist2, avelist3, lowlist3, highlist3 = [], [], [], [], [], [], [], [], []
avelistb, lowlistb, highlistb, avelistb2, lowlistb2, highlistb2, avelistb3, lowlistb3, highlistb3 = [], [], [], [], [], [], [], [], []
avelistc, lowlistc, highlistc, avelistc2, lowlistc2, highlistc2, avelistc3, lowlistc3, highlistc3 = [], [], [], [], [], [], [], [], []

for i, ii, iii, k, kk, kkk, j, jj, jjj in zip(a500s, a300s, a100s, b500s, b300s, b100s, c500s, c300s, c100s):
    newdiff = [(x - 500) / 500 for x in i]
    newdiff2 = [(x - 250) / 250 for x in ii]
    newdiff3 = [(x - 100) / 100 for x in iii]

    newdiffb = [(x - 500) / 500 for x in k]
    newdiffb2 = [(x - 250) / 250 for x in kk]
    newdiffb3 = [(x - 100) / 100 for x in kkk]

    newdiffc = [(x - 500) / 500 for x in j]
    newdiffc2 = [(x - 250) / 250 for x in jj]
    newdiffc3 = [(x - 100) / 100 for x in jjj]

    avelist.append(np.mean(newdiff))
    highlist.append(np.max(newdiff))
    lowlist.append(min(newdiff))

    avelist2.append(np.mean(newdiff2))
    highlist2.append(np.max(newdiff2))
    lowlist2.append(min(newdiff2))

    avelist3.append(np.mean(newdiff3))
    highlist3.append(np.max(newdiff3))
    lowlist3.append(min(newdiff3))
# ----------------------------------------------------
    avelistb.append(np.mean(newdiffb))
    highlistb.append(np.max(newdiffb))
    lowlistb.append(min(newdiffb))

    avelistb2.append(np.mean(newdiffb2))
    highlistb2.append(np.max(newdiffb2))
    lowlistb2.append(min(newdiffb2))

    avelistb3.append(np.mean(newdiffb3))
    highlistb3.append(np.max(newdiffb3))
    lowlistb3.append(min(newdiffb3))
# ----------------------------------------------------
    avelistc.append(np.mean(newdiffc))
    highlistc.append(np.max(newdiffc))
    lowlistc.append(min(newdiffc))

    avelistc2.append(np.mean(newdiffc2))
    highlistc2.append(np.max(newdiffc2))
    lowlistc2.append(min(newdiffc2))

    avelistc3.append(np.mean(newdiffc3))
    highlistc3.append(np.max(newdiffc3))
    lowlistc3.append(min(newdiffc3))

ave, low, high, aveb, lowb, highb, avec, lowc, highc = [], [], [], [], [], [], [], [], []

ave.append(np.mean(avelist))
ave.append(np.mean(avelist2))
ave.append(np.mean(avelist3))

aveb.append(np.mean(avelistb))
aveb.append(np.mean(avelistb2))
aveb.append(np.mean(avelistb3))

avec.append(np.mean(avelistc))
avec.append(np.mean(avelistc2))
avec.append(np.mean(avelistc3))

high.append(np.mean(highlist))
high.append(np.mean(highlist2))
high.append(np.mean(highlist3))

highb.append(np.mean(highlistb))
highb.append(np.mean(highlistb2))
highb.append(np.mean(highlistb3))

highc.append(np.mean(highlistc))
highc.append(np.mean(highlistc2))
highc.append(np.mean(highlistc3))

low.append(np.mean(lowlist))
low.append(np.mean(lowlist2))
low.append(np.mean(lowlist3))

lowb.append(np.mean(lowlistb))
lowb.append(np.mean(lowlistb2))
lowb.append(np.mean(lowlistb3))

lowc.append(np.mean(lowlistc))
lowc.append(np.mean(lowlistc2))
lowc.append(np.mean(lowlistc3))

xsign = ['100', '300', '500']

fig = plt.figure()

ax1 = fig.add_axes([0.08, 0.7, 0.83, 0.25])
ax3 = fig.add_axes([0.08, 0.38, 0.83, 0.25])  # (左右位置, 上下位置, 左右長度, 上下長度)
ax5 = fig.add_axes([0.08, 0.05, 0.83, 0.25])  # (左右位置, 上下位置, 左右長度, 上下長度)

aveb.reverse()
ax1.plot(aveb, '-.', label='Poisson', color='red')  # poia
ax1.set_ylim([-0.5, 1])
# ax2.set_ylim([-0.3, 0.2])

avec.reverse()
ax3.plot(avec, '--', label='Compare')  # cpd
ax3.set_ylim([-0.5, 1])
# ax4.set_ylim([-0.3, 0.2])

ave.reverse()
ax5.plot(ave, label='Our', color='black')  # c  # a3
ax5.set_ylim([-0.5, 1])
# ax6.set_ylim([-0.3, 0.2])

high.reverse()
highb.reverse()
highc.reverse()
low.reverse()
lowb.reverse()
lowc.reverse()
for x in range(3):
    ax1.vlines(x, highb[x], lowb[x])
    ax1.hlines(highb[x], x+0.05, x-0.05)
    ax1.hlines(lowb[x], x+0.05, x-0.05)

    ax3.vlines(x, highc[x], lowc[x])
    ax3.hlines(highc[x], x + 0.05, x - 0.05)
    ax3.hlines(lowc[x], x + 0.05, x - 0.05)

    ax5.vlines(x, high[x], low[x])
    ax5.hlines(high[x], x + 0.05, x - 0.05)
    ax5.hlines(low[x], x + 0.05, x - 0.05)

ax1.set_xticks(np.arange(len(xsign)))
ax1.set_xticklabels(xsign)
ax3.set_xticks(np.arange(len(xsign)))
ax3.set_xticklabels(xsign)
ax5.set_xticks(np.arange(len(xsign)))
ax5.set_xticklabels(xsign)

ax1.legend(bbox_to_anchor=(1, 1), loc='best', fontsize=10)
ax3.legend(bbox_to_anchor=(1, 1), loc='best')
ax5.legend(bbox_to_anchor=(1, 1), loc='best')

ax1.yaxis.set_major_locator(ticker.MultipleLocator(0.25))
ax3.yaxis.set_major_locator(ticker.MultipleLocator(0.25))
ax5.yaxis.set_major_locator(ticker.MultipleLocator(0.25))

vals = ax1.get_yticks()
ax1.set_yticklabels(['{:,.0%}'.format(x) for x in vals])

vals = ax3.get_yticks()
ax3.set_yticklabels(['{:,.0%}'.format(x) for x in vals])

vals = ax5.get_yticks()
ax5.set_yticklabels(['{:,.0%}'.format(x) for x in vals])

ax1.grid()
ax3.grid()
ax5.grid()

plt.show()

